import styled from "styled-components";

export const HomeMain = styled.main`
  * {
    font-family: Inter;
  }

  margin: 0;
  padding: 0;
  box-sizing: border-box;

  height: 100vh;
  width: 100vw;

  .content-wrapper {
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;

    height: 100vh;
    width: 100vw;
  }

  .socials {
    display: flex;
    justify-content: space-between;
    align-items: center;

    margin-top: 80px;
  }

  .socials a {
    display: flex;
    align-items: center;
    justify-content: space-around;

    background: #54b689;
    color: #fcfcfc;

    border-radius: 5px;

    text-decoration: none;

    padding: 10px;
    margin: 15px;

    /* width: 42px */
  }
`;
